	add("abomination", "{\"term\":\"abomination\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\"], \"text\":\"First attested around 1350. From Middle english (1100-1500) \u0027abominacioun\u0027 from Middle french (ca. 1400-1600) \u0027abomination\u0027 (horror, disgust) from {{m|la|abōminātiō||abomination}}; \u0027ab\u0027 (away from) + {{m|la|ōminārī||prophesy, foreboding}}, from {{m|la|ōmin||omen}}.\u0026lt;ref\u0026gt;{{R:CDOE|page\u003d4}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abominable act; a disgusting vice; a despicable habit. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The feeling of extreme disgust and hatred; abhorrence; detestation; loathing. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A state that excites detestation or abhorrence; pollution. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That which is abominable, shamefully vile; an object that excites disgust and hatred; very often with religious undertones. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Antony, most large in his \u0027\u0027abominations\u0027\u0027. Shakespeare, \u0027Antony and Cleopatra, III-vi\", \"priority\":5}]}, \"synonyms\":{}}");

