	add("aborticide", "{\"term\":\"aborticide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|abortion|cide|t2\u003dkilling|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of destroying a fetus in the womb; feticide\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, John Morris Dorsey, \u0027Psychology of ethics\u0027, page 153[http://books.google.com/books?id\u003dADKFh824Vk8C\u0026amp;pg\u003dPA153\u0026amp;dq\u003daborticide\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As physician I frequently find it helpful to express some of my views regarding prognosis, \u0027\u0027aborticide\u0027\u0027, euthanasia, organ transplant, and similar medical exertion of mine, including that of my well-intentioned fellow-man\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Paul DeParrie, \u0027The Rescuers\u0027, page 42[http://books.google.com/books?id\u003dyds0NjLEqlcC\u0026amp;q\u003daborticide\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Aborticide\u0027\u0027 is the basis of God\u0027s judgment on America,\u0026quot; he says, \u0026quot;because the blood cries out from the ground.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Lenn Evan Goodman, \u0027Judaism, human rights, and human values\u0027, page 88[http://books.google.com/books?id\u003d7hM9j0r0oe8C\u0026amp;pg\u003dPA88\u0026amp;dq\u003daborticide\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Thus we have a clear division between homicide, which falls within the biblical law of persons, and \u0027\u0027aborticide\u0027\u0027, which is treated as a tort\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An agent responsible for an abortion (the destruction of a fetus); abortifacient\", \"priority\":8}]}, \"synonyms\":{}}");

