	add("abortion", "{\"term\":\"abortion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|abortiō||miscarriage, abortion}}, from \u0027aborior\u0027 (miscarry) See \u0027abort\u0027 for more.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The cessation of pregnancy or fetal development\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a miscarriage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an induced abortion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of inducing the cessation of pregnancy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The immature product of an untimely birth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A monstrosity; a misshapen person\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Failure of a promise or a goal\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Arrest of development of any organ, so that it remains an imperfect formation or is absorbed\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any fruit or produce which is interrupted in its progress before it is matured or perfect; an idea, project, or anything that does not come to maturity\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Something ugly, an artistic atrocity\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, w:Charles Charles Dickens, \u0027Pictures from Italy\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dtext\u0026amp;offset\u003d269656481\u0026amp;textreg\u003d2\u0026amp;query\u003dabortion\u0026amp;id\u003dDicPict Chapter 10\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Insomuch that I do honestly believe, there can be no place in the world, where such intolerable \u0027\u0027abortions\u0027\u0027, begotten of the sculptor’s chisel, are to be found in such profusion, as in Rome\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The cessation of an illness or disease at a very early stage\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An unpleasant or poorly executed idea or project\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0026quot;foo...@my-deja.com\u0026quot;, \u0027Menace is AN \u0027\u0027ABORTION\u0027\u0027 OF A MOVIE\u0027 (on newsgroup \u0027alt.fan.starwars\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0026quot;Jules\u0026quot;, \u0027please dont buy beacon cd\u0027 (on newsgroup \u0027alt.fan.allman-brothers\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Dickey on his own manages to turn a simple bo diddley 1-2-3-4 into an absolute \u0027\u0027abortion\u0027\u0027 of a song\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, David Kerekes, \u0027Headpress 24: Powered by Love\u0027 (page 133\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"an absolute \u0027\u0027abortion\u0027\u0027 of a boo\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The act of aborting (an undertaking, such as a project or trip\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Fakhry A. Assaad, ‎James W. LaMoreaux, ‎Travis Hughes, \u0027Field Methods for Geologists and Hydrogeologists\u0027 (ISBN 3662054388), page 314\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The transfer or loss of the project manager before the project is completed will result in lost continuity and delay or the \u0027\u0027abortion\u0027\u0027 of the project and/or the report\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Gabriele Brandstetter, \u0027Poetics of Dance: Body, Image, and Space\u0027 (ISBN 0190266864), page 73\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"the abrupt \u0027\u0027abortion\u0027\u0027 of the trip after eleven days\", \"priority\":24}]}, \"synonyms\":{}}");

