	add("abortionist", "{\"term\":\"abortionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abortion|ist|lang\u003den}}. First attested in 1872.\u0026lt;ref name\u003dSOED\u0026gt;{{R:SOED5|page\u003d7}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who performs an illegal abortion in a non-medical setting (a back street, a hotel room, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Paul Krassner, \u0027One Hand Jerking: Reports from an Investigative Satirist\u0027 (ISBN 1583226966), page 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In 1962, when abortion was still illegal, I published an anonymous interview with Dr. Robert Spencer, a humane \u0027\u0027abortionist\u0027\u0027 who was known as “The Saint\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0026amp;ndash;2010\u0027\u0027, Roger Ebert, \u0027Roger Ebert\u0027s Movie Yearbook 2010\u0027, review of \u0027\u0027, page 146\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Then she asks her to go first to meet the \u0027\u0027abortionist\u0027\u0027. Then she neglects to make a reservation at the hotel the \u0027\u0027abortionist\u0027\u0027 specifies. That almost sinks the arrangement: The \u0027\u0027abortionist\u0027\u0027 has experience suggesting that hotel will be a safe venue, and suspects he may be set up for a police trap\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An abortion provider; one who performs a legal abortion\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dSuch a fetus is perfectly viable save for the act of the abortionist\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mark Juergensmeyer, \u0027Terror in the Mind of God: The Global Rise of Religious Violence\u0027 (ISBN 0520240111), page 24\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"According to Bray, \u0026quot;there is a difference between taking a retired \u0027\u0027abortionist\u0027\u0027 and executing him, and killing a practicing \u0027\u0027abortionist\u0027\u0027 who is regularly killing babies.\u0026quot; The first act is in Bray\u0027s view retributive, the second defensive\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027\u0027 (ISBN 0786739096), page 191\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"a gruesome procedure in which the \u0027\u0027abortionist\u0027\u0027 dismembers a child who could survive outside the womb\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"One who favors abortion being legal. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":12}]}, \"synonyms\":{}}");

	add("abortiveness", "{\"term\":\"abortiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abortive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being abortive. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The result or product of being abortive\", \"priority\":2}]}, \"synonyms\":{}}");

